
DROP DATABASE IF EXISTS NST;
CREATE DATABASE NST;
USE NST;

DROP TABLE IF EXISTS `regions`;

create table `regions`(
	id_bs VARCHAR(15) UNIQUE,
	id_object VARCHAR(12) DEFAULT NULL,
    operator ENUM('Т2', 'МТС', 'ВК', 'МФ') NOT NULL,
    category_object VARCHAR(50) DEFAULT NULL,
    type_search ENUM('Параллельный поиск', 'Закреплено'),
    date_to_work DATETIME DEFAULT NOW(),
    to_construction ENUM('Возможно', 'Ожидание') DEFAULT NULL,
    region ENUM('МО', 'ВО', 'ВрО', 'ИО', 'КО', 'КсО', 'РО', 'СО', 'Тверь', 'ТвО', 'ТлО', 'ЯрО') NOT NULL,
    `latitude` float UNSIGNED NOT NULL,
	`longitude` float UNSIGNED NOT NULL,
	adress VARCHAR(255) NOT NULL,
	district VARCHAR(100) DEFAULT NULL,
	su_height FLOAT DEFAULT NULL,
	status_object ENUM('ПОИСК', 'На согласовании СО', 'На согласовании АДМ', 'Согласовано СО', 'Согласовано АДМ', 'НА ГЕО', 'ГЕО готова', 'Подано на ПУД', 'ПУД', 'Отказ в ПУД', 'Отказ от зоны поиска', 'Отозвано СО', 'Подано на ордер', 'Ордер', 'Фундамент', 'Опора', 'Построено'),
	date_status DATETIME DEFAULT NOW(),
	comment TEXT DEFAULT NULL,
	person VARCHAR(100) DEFAULT NULL,
	
	INDEX bs_idx(id_bs),
	INDEX object_idx(id_object),
	INDEX region_idx(region),
	INDEX operator_idx(operator)
);


DROP TRIGGER IF EXISTS update_date_status;
delimiter //
CREATE TRIGGER update_date_status BEFORE UPDATE ON `regions`
FOR EACH ROW
BEGIN
	IF NEW.status_object <> OLD.status_object THEN
   		SET NEW.date_status = NOW();
  	END IF;
  
END //
delimiter ;

