/*
 VIEW для просмотра статуса работы по объекту и условий заказа.
 */


DROP VIEW IF EXISTS status_region_documenting;
 
CREATE VIEW status_region_documenting AS SELECT r.id_bs , r.status_object as `status`, d.deadline 
FROM NST.regions r join NST.documenting d on r.id_bs = d.id_bs
WHERE r.status_object <> 'Построено' ORDER BY d.deadline;

SELECT * FROM status_region_documenting;



/*
 VIEW для просмотра самых долгостроящихся объектов по ответственным / медленных сотрудников.
 */


DROP VIEW IF EXISTS deadline_completion;
 
CREATE VIEW deadline_completion AS SELECT r.id_bs, r.person, r.date_to_work, d.deadline 
FROM NST.regions r join NST.documenting d on r.id_bs = d.id_bs
WHERE r.status_object <> 'Построено';

SELECT person, DATEDIFF(now(), deadline) as delay FROM deadline_completion
order BY delay DESC;

/*
 SELECT всех этапов строительства с учетом Энергетики и статус объекта в Региональной работе.
 */

SELECT r.id_object, r.adress, r.status_object, c.status, pe.data_request_TU , pe.date_received_TU 
FROM construction c join power_engineering pe on c.id_object = pe.id_object join regions r on pe.id_object = r.id_object 
WHERE r.status_object <> 'Построено';


/*
 Количество объектов на разных этапах строительства
 */

SELECT status, COUNT(status) 
FROM construction c
WHERE status <> 'Готово'
group by status;

/*
 Количество объектов в работе по регионам РФ
 */

SELECT r.region, COUNT(r.region) as volume 
FROM regions r join construction c on r.id_object = c.id_object 
WHERE r.status_object <> 'Отозвано СО' and r.status_object <> 'Отказ от зоны поиска' and c.status <> 'Готово'
group by r.region
order by volume DESC;

/*
 * Выборка самых дорогостоящих объектов с определением владельцев Зем.участка и владельца объеекта
 */

SELECT c.id_object, c.adress, o.ownership_object, o.ownership_land 
FROM  construction c join ownership o on c.id_object = o.id_object
WHERE c.id_object IN (SELECT so.id_object 
           FROM sold_object so 
           WHERE so.total > 10000000);
          

/*
* PROCEDURE Напоминание приближающегося дедлайна, с возможность выбора "количество дней до" и менее.
 */
          
DROP PROCEDURE IF EXISTS `alarm_deadline` 
          
DELIMITER // 
CREATE PROCEDURE `alarm_deadline` (day_before int)
BEGIN
	
	SELECT r.id_bs, r.region, r.adress, r.status_object, d.deadline 
	FROM regions r join documenting d on r.id_bs = d.id_bs 
	WHERE day_before >= DATEDIFF(d.deadline, now());
	
	
END //

DELIMITER ;
 
CALL alarm_deadline(10);


/*
* PROCEDURE для внесения в таблицу SOLD_OBJECT данных, с проверкой на ошибку дубликата. 
 */

DROP PROCEDURE IF EXISTS `add_sold_object`;

DELIMITER // 
CREATE PROCEDURE `add_sold_object` (id_object VARCHAR(12),
									number_doc VARCHAR(255),
    								data_doc DATE,
    								total INT,
									sold VARCHAR(15))
BEGIN
	DECLARE EXIT HANDLER FOR 1062
	SELECT CONCAT('Объект c ID № ', id_object, ', уже внесен в таблицу') as msg;

	VALUES (id_object, number_doc, data_doc, total, sold);
	
	
END //

DELIMITER ;
 
CALL add_sold_object('764', '9303', '1980-02-26', 0, 'НЕТ');

